SELECT	type.name AS issue_type,	s.name AS status,	i.key AS issue_key,	i.id AS issue_id,	i.parent_id AS parent_id,	parent.key AS parent_key,	p.key AS project_key,	p.name AS project_nameFROM jra.issue AS iLEFT JOIN jra.issue AS parent	ON i.parent_id = parent.idINNER JOIN jra.project AS p	ON i.project = p.id	AND p._fivetran_deleted IS FALSEINNER JOIN jra.issue_type AS type	ON i.issue_type = type.idINNER JOIN jra.status AS s	ON i.status = s.idWHERE	1 = 1	AND i._fivetran_deleted IS FALSE	AND s.name NOT IN ('Canceled', 'Duplicate')	AND p.key NOT IN (		'AAM',		'AG',		'AH',		'AWS',		'BI',		'COM',		'COO',		'DBCLEAN',		'DC',		'DG',		'DTC',		'EFDB',		'ESGR',		'FINA',		'IM',		'KB',		'LR',		'MAR',		'MNGAC',		'OP',		'PTINC',		'PTSI',		'SUS',		'TEST',		'TI',		'TM',		'TV2'	)